script: |
  super -f text -I q3168.spq | sort > q3168.out

inputs:
  - name: q3168.spq
    data: |
      SELECT ALL col0 AS col2 FROM tab1 (FORMAT parquet) WHERE - 97 NOT BETWEEN + 39 - - col2 AND + col0 * - col2 + - col0;
  - name: tab1

outputs:
  - name: q3168.out
    data: |
      51
      85
      91
